import React from "react";
import styled from "styled-components";

const Container = styled.div`
    flex: 1;
    background-color: #202020;
    height: 100vh;
    color: #fff;
`;

const Wrapper = styled.div`
    padding: 15px 20px;
`;

const Logo = styled.div`
display:flex;
align-items:center;
gap:5px;
`;

const Img = styled.img`
    height
`;

const Menu = () => {
    return (
        <Container>
            <Wrapper>menu items</Wrapper>
        </Container>
    );
};

export default Menu;
